    //     uint256 GK,
    //     uint256 TH,
    //     uint256 CK
    // ) external;

    function addStudentToSubject(address[] memory _students) external;

    function confirmCompletedAddress(
        address[] calldata _student
        // uint256[] calldata _score,
        // ScoreColumn _column
    ) external;

    function close() external;
}

